import React, { useEffect, useState } from 'react';

const Cars = () => {
    const [cars,setCars] = useState([])
    useEffect(()=>{
        fetch('./FakeData.JSON')
        .then(res=>res.json())
        .then(data=>setCars(data))
    },[])

    console.log(cars);

    return (
        <div className="row g-2">
            <div className="col-lg-9">
                {
                    cars.map(car=><Car></Car>)
                }
            </div>
            <div className="col-lg-3">

            </div>
        </div>
    );
};

export default Cars;
